// swaps two values
void swap(int *x, int *y) {
	int temp = *x;
	*x = *y;
	*y = temp;
}

// launches swap cycle and waits for swap to happen before returning
void wait_for_vsync() {
	volatile int *pixel_ctrl_ptr = (int*)0xff203020;
	int status;
	// launch the swap process
	*pixel_ctrl_ptr = 1;
	//poll status bit
	status = *(pixel_ctrl_ptr + 3);
	while (!(status & 0x01) == 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
	// status bit s = 0, can exit
}


// draws a line from (x1, y1) to (x2, y2)
void draw_line(int x0, int y0, int x1, int y1, short int colour) {
	bool is_steep = abs(y1-y0) > abs(x1-x0);
	if (is_steep) {
		swap(&x0, &y0);
		swap(&x1, &y1);
	}
	
	if (x0 > x1) {
		swap(&x0, &x1);
		swap(&y0, &y1);
	}
	
	int dx = x1 - x0;
	int dy = abs(y1 - y0);
	int error = -(dx / 2);
	int y = y0;
	int y_step = -1;
	
	if (y0 < y1) {
		y_step = 1;
	}
	
	for (int x = x0; x <= x1; x++) {
		if (is_steep) {
			plot_pixel(y, x, colour);
		} else {
			plot_pixel(x, y, colour);
		}
		error = error + dy;
		if(error >= 0) {
			y = y + y_step;
			error = error - dx;
		}
	}
}



// clears the VGA screen
void black_screen() {
	for (int x = 0; x < resolutionX; x++) {
		for (int y = 0; y < resolutionY; y++) {
			plot_pixel(x, y, BLACK);
		}
	}
}

// draws a pixel on screen
void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


/* interrupt setup handler functions */

/* Initialize the banked stack pointer register for IRQ mode */
void set_A9_IRQ_stack(void) {
    int stack, mode;
    stack = 0xFFFFFFFF - 7; // top of A9 on-chip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]" : : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

/* Turn on interrupts in the ARM processor */
void enable_A9_interrupts(void) {
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}
/* Configure the Generic Interrupt Controller (GIC) */
void config_GIC(void) {
	config_interrupt (79, 1); // configure the FPGA KEYs interrupt (73)
	// Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all priorities
	*((int *) 0xFFFEC104) = 0xFFFF;
	// Set CPU Interface Control Register (ICCICR). Enable signaling of interrupts
	*((int *) 0xFFFEC100) = 1; // enable = 1
	// Configure the Distributor Control Register (ICDDCR) to send pending interrupts to CPUs
	*((int *) 0xFFFED000) = 1; // enable = 1
}

/*
* Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target
* Registers (ICDIPTRn). The default (reset) values are used for other registers
* in the GIC.
*/
void config_interrupt(int N, int CPU_target) {
	int reg_offset, index, value, address;
	/* Configure the Interrupt Set-Enable Registers (ICDISERn).
	* reg_offset = (integer_div(N / 32) * 4
	* value = 1 << (N mod 32) */
	reg_offset = (N >> 3) & 0xFFFFFFFC;
	index = N & 0x1F;
	value = 0x1 << index;
	address = 0xFFFED100 + reg_offset;
	/* Now that we know the register address and value, set the appropriate bit */
	*(int *)address |= value;

	/* Configure the Interrupt Processor Targets Register (ICDIPTRn)
	* reg_offset = integer_div(N / 4) * 4
	* index = N mod 4 */
	reg_offset = (N & 0xFFFFFFFC);
	index = N & 0x3;
	address = 0xFFFED800 + reg_offset + index;
	/* Now that we know the register address and value, write to (only) the
	* appropriate byte */
	*(char *)address = (char)CPU_target;
}

// enable keyboard interrupts
void config_keyboard() {
	volatile int * PS2_ptr = (int *) 0xFF200100;
	*(PS2_ptr + 1) = 0x00000001; // RE = 1
}

// handle a keyboard interrupt
void keyboard_ISR() {
	volatile int * PS2_ptr = (int *) 0xFF200100;  // points to interrupt base register
	int PS2_data, RVALID;
	unsigned char keyBit;
	
	PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
	RVALID = PS2_data & 0x8000; // extract the RVALID field (16th bit)
	
	// disable the interrupt
	int RE_bit = *(PS2_ptr + 1); 
	*(PS2_ptr+1) = RE_bit; 
	
	// if there is data to be read
	if (RVALID) {
		keyBit = (PS2_data & 0xFF); // read lower 8 bits of data from keyboard reg
		
		if (keyBit == 0x75) { // up arrow
			move_tiles('U');
		} else if (keyBit == 0x72) { // down arrow
			move_tiles('D');
		} else if (keyBit == 0x6B) { // left arrow
			move_tiles('L');
		} else if (keyBit == 0x74) { // right arrow
			move_tiles('R');
		}
	}
	return;
}

/* Define the IRQ exception handler */
void __attribute__ ((interrupt)) __cs3_isr_irq (void) {
	// Read the ICCIAR from the processor interface
	int int_ID = *((int *) 0xFFFEC10C); 
	if (int_ID == 79) { // check if interrupt is from the keyboard
		keyboard_ISR();
	} else {
		while (1){} // if unexpected, then stay here
	}
	// Write to the End of Interrupt Register (ICCEOIR)
	*((int *) 0xFFFEC110) = int_ID;
	return;
}
// Define the remaining exception handlers */
void __attribute__ ((interrupt)) __cs3_isr_undef (void) {
	while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_swi (void) {
	while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_pabort (void) {
	while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_dabort (void) {
	while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_fiq (void) {
	while (1);
}

